import React from 'react'
import { Text, View, StyleSheet, Image, TouchableOpacity, TextInput } from 'react-native';
import Constants from 'expo-constants';
import { createNativeStackNavigator } from '@react-navigation/native-stack'
import { NavigationContainer } from '@react-navigation/native';

const Profil = ({ navigation }) => {
    return (
        <View style={styles.root}>
            <View style={styles.atas}>
                <Text style={styles.teks}>
                    Akun
                </Text>
            </View>
            <View style={styles.profil}>
                <Text>
                    Mie Goreng
                </Text>
            </View>

            <View style={styles.container} >

                <View style={styles.gambar}>
                    <Image
                        style={styles.image}
                        source={require('../assets/gambar/delivery.png')}
                    />
                </View>
                <View style={styles.keterangan}>
                    <View style={styles.text}>
                        <Text >PickUp</Text>
                        <Text >Pesanan akan siap dalam</Text>

                    </View>
                    <TouchableOpacity style={styles.ganti} onPress={() => navigation.navigate('PickUp')}>
                        <Text style={styles.ganti}>Ganti</Text>
                    </TouchableOpacity>
                    
                </View>
            </View>
            
        </View>
    );
}

const styles = StyleSheet.create({
    
    container: {
        flexDirection: 'row',
        margin: 5,
    },
    atas: {
        height: 54,
        width: '100%',
        backgroundColor: '#99d1d8',
        position: 'relative',
        justifyContent: 'center',
        alignItems: 'center'
    },
    teks: {
        color: '#875749',
        fontWeight: 'bold',
        fontSize: 20
    },
    profil: {
        alignItems: "center",
        backgroundColor: "#99d1d8",
        width: '100%',
        height: 60,
        justifyContent: 'center',
        position: 'relative',
        top: 20,
        left: 10,
        marginTop: 15
    },
    gambar: {
        width: '20%',
        height: 70,
        backgroundColor: '#99D1D8',
        padding: 10,
        textAlign: 'center'
    },
    image: {
        width: 60,
        height: 60,
    },
    keterangan: {
        width: '80%',
        height: 70,
        backgroundColor: '#99D1D8',
        padding: 10,
        // flex: 1,
        flexDirection: 'row',

    },
    text: {
        width: '70%'
    },
});

export default Profil;
